import React from 'react'
import OnOffClasses from './OnOff.module.css'

type OnOffPropsType = {
    status: boolean
}

export function OnOff(props: OnOffPropsType) {
    return props.status ?
        <div className={'on'}><button>ON</button></div> :
        <div className={'.off'}><button>OFF</button></div>
}
